//demo code for radial progress
$(function () {
    
    //radial progress 4
    var radialObj4 = $('.indicatorContainer4').radialIndicator({
        barColor: {
            0: 'red',
            20:"#ff9041",
            40:"#ffd641",
            60:"#c7ff41",
            80:"#8aff41",
            100: '#33CC33'
        },
        roundCorner : true,
        barWidth:10,
        barTime:5,
        percentage: true
    }).data('radialIndicator');

    //add textbox and buttons for all radial button
    function servicew(){
        $('.prg-cont').each(function () {
            var elm = $.single(this),
                wrap = elm.wrap('<div class="prg-cont-wrap"></div>').closest('.prg-cont-wrap'),
                radObj = wrap.find('.rad-prg').data('radialIndicator');
                var val = $(this).attr("number");
                radObj.animate(val);
        });
    }
   
    function sdfasd(className,customOffset){
        var waypoints = $(className).waypoint({
            handler:  servicew,
            offset: customOffset
        });
    }
    sdfasd(".indicatorContainer4","70%");

    /*container.on({
        'dragenter': function (e) {
            msgHolder.html("Drop here");
        },
        'dragleave': function (e) {
            msgHolder.html("Click / Drop file to select.");
        },
        'drop': function (e) {
            e.preventDefault();
            handleFileUpload(e.originalEvent.dataTransfer.files);
        }
    });*/
});;